-- ----------------------------
-- View structure for Full_Balances
-- ----------------------------
DROP VIEW IF EXISTS "Full_Balances";
CREATE VIEW "Full_Balances" AS  SELECT tps.tp_id,
    t.name,
    tps.sec_id,
    s.code,
    tps.sec_type,
    tps.hedge_kf,
    tps.pdtosecid,
    s.pdps_def,
    COALESCE(b.quantity, 0) AS qty,
        CASE tps.sec_type
            WHEN 'P'::text THEN COALESCE(bp.quantity, 0)
            ELSE COALESCE(bb.quantity, 0)
        END AS qtybase,
    (- round((tps.hedge_kf * (
        CASE tps.sec_type
            WHEN 'P'::text THEN COALESCE(bp.quantity, 0)
            WHEN 'B'::text THEN (- COALESCE(bb.quantity, 0))
            ELSE COALESCE(bb.quantity, 0)
        END)::double precision))) AS qtyneed,
    COALESCE(tb.bl, (0)::bigint) AS qtybytrades,
        CASE
            WHEN (s.pricestep > (0)::double precision) THEN ((COALESCE(tb.val, (0)::double precision) * s.pricedriver) / s.pricestep)
            ELSE COALESCE(tb.val, (0)::double precision)
        END AS "Value",
    COALESCE(ot.summqtyoff, (0)::bigint) AS qtyoff,
    COALESCE(ot.summoffresult, (0)::double precision) AS offresult,
    s.lotsize,
    tps.pd_kf,
    s.pricestep
   FROM (((((((tp_sec tps
     LEFT JOIN tp t ON ((t.tpid = tps.tp_id)))
     LEFT JOIN securities s ON ((tps.sec_id = s.securityid)))
     LEFT JOIN balance b ON (((tps.tp_id = b.tpid) AND (tps.sec_id = b.securityid))))
     LEFT JOIN balance bp ON (((tps.tp_id = bp.tpid) AND (tps.pdtosecid = bp.securityid))))
     LEFT JOIN ( SELECT b_1.tpid,
            b_1.securityid,
            b_1.quantity
           FROM (balance b_1
             LEFT JOIN tp_sec tps_1 ON (((tps_1.tp_id = b_1.tpid) AND (tps_1.sec_id = b_1.securityid))))
          WHERE ((tps_1.sec_type)::text = 'B'::text)) bb ON ((tps.tp_id = bb.tpid)))
     LEFT JOIN ( SELECT trades._tpid,
            trades.code,
            sum(((trades.quantity - trades.qtyoff) *
                CASE trades.buysell
                    WHEN 'B'::text THEN 1
                    ELSE '-1'::integer
                END)) AS bl,
            sum((((trades.value / (trades.quantity)::double precision) * ((trades.quantity - trades.qtyoff))::double precision) * (
                CASE trades.buysell
                    WHEN 'B'::text THEN '-1'::integer
                    ELSE 1
                END)::double precision)) AS val
           FROM trades
          WHERE (trades.quantity <> trades.qtyoff)
          GROUP BY trades._tpid, trades.code) tb ON (((tps.tp_id = tb._tpid) AND ((s.code)::text = (tb.code)::text))))
     LEFT JOIN ( SELECT offtrades.code,
            offtrades.tpid,
            sum(offtrades.qtyoff) AS summqtyoff,
            sum(offtrades.offresult) AS summoffresult
           FROM offtrades
          WHERE (offtrades.offtime >= CURRENT_DATE)
          GROUP BY offtrades.code, offtrades.tpid) ot ON (((tps.tp_id = ot.tpid) AND ((s.code)::text = (ot.code)::text))));

-- ----------------------------
-- Records of tradescheldue
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- View structure for TP_Balances_2
-- ----------------------------
DROP VIEW IF EXISTS "TP_Balances_2";
CREATE VIEW "TP_Balances_2" AS  SELECT fb.tp_id,
    fb.name,
    (- bq.qty) AS qty,
        CASE bq.qty
            WHEN 0 THEN ((0)::numeric(16,2))::double precision
            ELSE (sum(((fb."Value" * fb.pdps_def) * (
            CASE fb.sec_type
                WHEN 'P'::text THEN 0
                ELSE 1
            END)::double precision)) / ((bq.qty)::numeric(16,2))::double precision)
        END AS basis,
    (sum((fb.meanpricerur *
        CASE fb.sec_type
            WHEN 'H'::text THEN fb.hedge_kf
            WHEN 'B'::text THEN (- fb.hedge_kf)
            ELSE (0)::real
        END)) + p.cashshift) AS basismean,
    sum((fb.offresult * fb.pdps_def)) AS fifo_result
   FROM (("Full_Balances_2" fb
     LEFT JOIN ( SELECT DISTINCT "Full_Balances_2".tp_id,
            "Full_Balances_2".qty
           FROM "Full_Balances_2"
          WHERE (("Full_Balances_2".sec_type)::text = 'B'::text)) bq ON ((fb.tp_id = bq.tp_id)))
     LEFT JOIN tp p ON ((fb.tp_id = p.tpid)))
  WHERE (p.isactive <> B'0'::"bit")
  GROUP BY fb.tp_id, fb.name, bq.qty, p.cashshift;

-- ----------------------------
-- Records of tradescheldue
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- View structure for Full_Balances_2
-- ----------------------------
DROP VIEW IF EXISTS "Full_Balances_2";
CREATE VIEW "Full_Balances_2" AS  SELECT t.tp_id,
    t.name,
    t.sec_id,
    t.code,
    t.sec_type,
    t.hedge_kf,
    t.pdtosecid,
    t.pdps_def,
    t.qty,
    t.qtybase,
    t.qtyneed,
    t.qtybytrades,
    t."Value",
    t.qtyoff,
    t.offresult,
    t.pricestep,
    t.meanprice,
    t.pdlotsize,
    t.pd_kf,
    t.meanpricepd,
        CASE COALESCE((t.pricestep * (t.pdlotsize)::double precision), (0)::double precision)
            WHEN 0 THEN t.meanprice
            ELSE ((((t.meanprice * t.meanpricepd) * t.pd_kf) / (t.pdlotsize)::double precision) / t.pricestep)
        END AS meanpricerur
   FROM ( SELECT t1.tp_id,
            t1.name,
            t1.sec_id,
            t1.code,
            t1.sec_type,
            t1.hedge_kf,
            t1.pdtosecid,
            t1.pdps_def,
            t1.qty,
            t1.qtybase,
            t1.qtyneed,
            t1.qtybytrades,
            t1."Value",
            t1.qtyoff,
            t1.offresult,
            t1.pricestep,
            (-
                CASE t1.qty
                    WHEN 0 THEN (0)::double precision
                    ELSE (t1."Value" / (t1.qty)::double precision)
                END) AS meanprice,
            COALESCE(t2.lotsize, 0) AS pdlotsize,
            COALESCE(t2.pd_kf, (0)::real) AS pd_kf,
            COALESCE(t2.meanpricepd, (0)::double precision) AS meanpricepd
           FROM ("Full_Balances" t1
             LEFT JOIN ( SELECT "Full_Balances".tp_id,
                    "Full_Balances".pdtosecid,
                    "Full_Balances".lotsize,
                    "Full_Balances".pd_kf,
                    (-
                        CASE "Full_Balances".qty
                            WHEN 0 THEN (0)::double precision
                            ELSE ("Full_Balances"."Value" / ("Full_Balances".qty)::double precision)
                        END) AS meanpricepd
                   FROM "Full_Balances") t2 ON (((t1.tp_id = t2.tp_id) AND (t1.sec_id = t2.pdtosecid))))) t;

